    Link,
    Outlet,
    useParams
} from "react-router-dom";



function NotFound(){
  return(
    <div>
      <h1>Not Found</h1>
      <p>Sorry your page was not Found</p>
    </div>
  );
}

function Home(){
  return(
  <div>
    <h1>Welcome Home!</h1>
  </div>
  );
}

function Launch(){
  return(
    <div>
      <h1>Launch</h1>

      <Outlet />
    </div>
  );
}

function LaunchIndex(){
  return(
  <ul>
    {Object.entries(shoes).map(([slug, {name, img}])=>(
      <li key={slug}>
      <Link to ={`/lauch/${slug}`}>
      <h2>{name}</h2>
      <img src= {img} alt={name}/>
      </Link>
    </li>

    ))}
    </ul>
  );
}

function LaunchShoe(){
  const { slug } = useParams();
  const shoe = shoes[slug];

  if(!shoe){
    return<h2>Not Found</h2>
  }

  const {name, img} = shoe;

  return(
  <div>
    <h2>{ name }</h2>
    <img src={img} alt={name}/>
  </div>
  );
}

